  `android_file_path` varchar(255) DEFAULT NULL COMMENT 'android图片存储路径',
  `mobile_file_path` varchar(255) DEFAULT NULL COMMENT '手机网站图片存储路径',
  `pc_file_path` varchar(255) DEFAULT NULL COMMENT 'pc图片存储位置',
  `subject_name` varchar(255) DEFAULT NULL COMMENT '主题名称',
  `subject_type` int(10) DEFAULT NULL COMMENT '1 商品列表，2 商品详情 3 url页面，4 宣传页面',
  `subject_url` varchar(255) DEFAULT NULL COMMENT '类型为3的时候存储url地址',
  `subject_content` longtext COMMENT '主题html内容，subject_type为4时，存储html富文本内容',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '创建时间',
  `ord` int(10) DEFAULT '0' COMMENT '活动排序',
  `remark` varchar(255) DEFAULT NULL COMMENT '主题备注',
  `status` int(10) DEFAULT '1' COMMENT '-1：删除、0：不启用、1：启用',
  `subject_hint` varchar(255) DEFAULT NULL COMMENT '主题提示',
  `suject_url` varchar(255) DEFAULT NULL COMMENT '轮播图打开地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

