-- ----------------------------
-- Table structure for tb_sys_type
-- ----------------------------
DROP TABLE IF EXISTS `tb_sys_type`;
CREATE TABLE `tb_sys_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `nid` bigint(20) DEFAULT '0' COMMENT '处理分布式部署问题，数据关联全部使用nid进行关联',
  `code` varchar(50) DEFAULT NULL COMMENT '编码',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父级id',
  `parent_nid` bigint(20) DEFAULT NULL COMMENT '父级nid',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `type` varchar(50) DEFAULT NULL COMMENT '类型分类：grid:表格列、query:查询、validate:验证',
  `ord` bigint(20) DEFAULT '1' COMMENT '排序',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `status` int(10) DEFAULT '1' COMMENT '状态字段 1正常，0锁定，-1删除',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
