-- ----------------------------
-- Table structure for tb_sys_user
-- ----------------------------
DROP TABLE IF EXISTS `tb_sys_user`;
CREATE TABLE `tb_sys_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `nid` bigint(20) DEFAULT '0' COMMENT '处理分布式部署问题，数据关联全部使用nid进行关联',
  `inst_id` bigint(20) DEFAULT NULL COMMENT '行业id',
  `inst_nid` bigint(20) DEFAULT NULL COMMENT '行业nid',
  `inst_code` varchar(64) DEFAULT NULL COMMENT '行业编码',
  `unit_id` bigint(20) DEFAULT NULL COMMENT '单位id 区分不同单位的部门',
  `unit_nid` bigint(20) DEFAULT NULL COMMENT '单位nid，区分不同单位的部门',
  `unit_code` varchar(64) DEFAULT NULL COMMENT '单位编码',
  `account` varchar(30) DEFAULT NULL COMMENT '用户账号',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `user_name` varchar(20) DEFAULT NULL COMMENT '用户名称',
  `mobile` varchar(11) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `user_cord` varchar(30) DEFAULT NULL COMMENT '身份证号',
  `is_sys` bigint(10) DEFAULT '0' COMMENT '是否系统用户： 1 是，0 否 ',
  `ord` bigint(20) DEFAULT '1' COMMENT '排序',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `status` int(10) DEFAULT '1' COMMENT '状态字段 1正常，0锁定，-1删除',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `data_1` bigint(20) DEFAULT NULL COMMENT '冗余字段1',
  `data_2` varchar(50) DEFAULT NULL COMMENT '冗余字段2',
  `data_3` varchar(100) DEFAULT NULL COMMENT '冗余字段3',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10000072 DEFAULT CHARSET=utf8 COMMENT='人员表';

-- ----------------------------
-- Records of tb_sys_user
-- ----------------------------

