  `data_4` double(20,0) DEFAULT NULL COMMENT '备用字段',
  `data_5` int(10) DEFAULT NULL COMMENT '备用字段',
  `data_6` bigint(20) DEFAULT NULL COMMENT '备用字段',
  PRIMARY KEY (`id`)
